import React from 'react';
import styled from 'styled-components'

const StyledSlideOne = styled.div`
  .background-top {
    background: #FAC943;
    width: 100%;
    height: 0.84vh;
  }
  .background-bottom {
    background: #FFFFFF;
    width: 100%;
    height: 0.16vh;
  }
`;

function SlideOne() {
  return (
    <StyledSlideOne>
      <div className='background-top'/>
      <div className='background-bottom' />
    </StyledSlideOne>
  );
}

export default SlideOne;
